, x, y, s, t, ans;

	W = in(), H = in(), K = in(), N = in();
	H >>= 1;
	K -= (W>>1)+1; if (K < 0) { puts("-1"); return 0; }
	while (N--) {
		x = in()-1, y = in()-1;
		if (y & 1) dog[y>>1][x] = 1;
	}

	s = 0;
	for (y = 0; y < H; y++) {
		memset(dp, INF, (W+1)<<2);
		dp[0] = 0;
		for (x = 0; x < W; x++) {
			if (x & 1) dp[x+1] = dp[x];
			else {
				t = dp[x] + dog[y][x];
				if (dp[x+1] > t) dp[x+1] = t;
				if (x >= 2) {
					t = dp[x-2] + (dog[y][x-1]<<1);
					if (dp[x+1] > t) dp[x+1] = t;
				}
			}
		}
		s += dp[W];
	}
	ans = H*((W>>1)+1) + s;
	if (s > K) s = K;
	ans -= s<<1, K -= s;
	if (ans > K) ans -= K; else ans = 0;
	printf("%d\n", ans);
	return 0;
}
